import React from 'react';

const HealthImpactPanel = ({ healthData }) => {
  if (!healthData || !healthData.health_impact) {
    return (
      <div className="health-impact-panel error">
        <h3>Health Impact</h3>
        <p>No health data available</p>
      </div>
    );
  }

  const { health_impact, who_guidelines, pm25 } = healthData;

  return (
    <div className="health-impact-panel">
      <h3>Health Impact Assessment</h3>

      <div className="health-status">
        <div className={`status-indicator ${health_impact.level.toLowerCase().replace(/\s+/g, '-')}`}>
          {health_impact.level}
        </div>
      </div>

      <div className="health-details">
        <h4>Current Impact</h4>
        <p>{health_impact.impact}</p>

        <h4>Recommendations</h4>
        <ul>
          {health_impact.recommendations.map((rec, index) => (
            <li key={index}>{rec}</li>
          ))}
        </ul>
      </div>

      <div className="who-guidelines">
        <h4>WHO Guidelines Reference</h4>
        <div className="guideline-comparison">
          <div className="guideline-item">
            <span className="label">Your PM2.5 Level:</span>
            <span className="value">{pm25 ? `${pm25} μg/m³` : 'N/A'}</span>
          </div>
          <div className="guideline-item">
            <span className="label">WHO Daily Limit:</span>
            <span className="value">{who_guidelines.pm25.daily} μg/m³</span>
          </div>
          <div className="guideline-item">
            <span className="label">WHO Annual Limit:</span>
            <span className="value">{who_guidelines.pm25.annual} μg/m³</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HealthImpactPanel;
